using Cosmos.Data.Cerulean.Cloud;
using Interfaces.Cerualean.Cloud;
using Microsoft.AspNetCore.Components;

namespace Frontend.Cerulean.Cloud.Pages.Admin
{
    public partial class AddProduct
    {
        [Inject]
        private ICosmosService _cosmosService {get; set;}

        private async Task AddItem() {
            Random rnd = new Random(DateTime.Now.Second);

            string[] urls = new string[] {
                "data:image/jpeg;base64,",
                "data:image/jpeg;base64,",
                "data:image/jpeg;base64,",
                "data:image/jpeg;base64,",
                "data:image/jpeg;base64,",
                "data:image/jpeg;base64,",
                "data:image/jpeg;base64,"
            };


            for (int i = 0; i < 10; i++) {
                string guid = Guid.NewGuid().ToString();
                string time = DateTime.Now.ToShortDateString();
                Product product = new(guid, guid, time);
                product.Attributes = new List<ProductAttribute>()
                {
                    new ProductAttribute() {
                        Key = $"{rnd.NextInt64(1, 20)}",
                        Value = Guid.NewGuid().ToString(),
                        Locale = "en"
                    },
                                    new ProductAttribute() {
                        Key = $"{rnd.NextInt64(1, 20)}",
                        Value = Guid.NewGuid().ToString(),
                        Locale = "nl"
                    },
                    new ProductAttribute() {
                        Key = $"{rnd.NextInt64(1, 20)}",
                        Value = Guid.NewGuid().ToString(),
                        Locale = "de"
                    },
                };


                var tagId = $"{rnd.NextInt64(1, 20)}";
                product.Tags = new List<Tag>()
                {
                    new Tag() {
                        Key = tagId,
                        TagName = $"en-{Guid.NewGuid().ToString()}",
                        Locale = "en"
                    },
                    new Tag() {
                        Key = tagId,
                        TagName = $"nl-{Guid.NewGuid().ToString()}",
                        Locale = "nl"
                    },
                    new Tag() {
                        Key = tagId,
                        TagName = $"de-{Guid.NewGuid().ToString()}",
                        Locale = "de"
                    },
                };

                var imgId = rnd.NextInt64(0, 6);
                product.Images = new List<Image>()
                {
                    new Image() {
                        Url = urls[imgId],
                        Type = "first"
                    }
                };


                await _cosmosService.AddItemAsync(product);


            }

        }
    }
}
